import React from "react";
import logo from "../../images/logo.png";
import { IconLayoutGrid, IconLockOpen, icons, IconStethoscope } from '@tabler/icons-react';
import { Text } from '@mantine/core';
import { url } from "inspector";
const links =[
    {
      name:"Dashboard",url:"/dashboard",icons:<IconLayoutGrid stroke={1.5}/>
    },
    {
      name:"Doctors",url:"/doctors",icons:<IconStethoscope stroke={1.5}/>
    },
]
const Sidebar = () => {
    return (
        <div className="w-64 bg-gradient-to-b from-[#18A5A7] to-[#BFFFC7]">
            <div className="text-red-500 text-center gap-8">
                <img src={logo} style={{ width: '100%', height: '150px' }} alt='img' />

            </div>
            <div className="p-1 bg-[#02587B] flex justify-center gap-2 font-heading font-bold text-xl text-white tracking-wide">  
                    <IconLockOpen stroke={2} className="w-5 h-5" />
                     <Text size="md">Admin</Text>
            </div>
        </div>
    )
}
export default Sidebar
